import React from "react";
import {Card, CardHeader, styled} from "@mui/material";



const RecipeCard = ({name}) => {

    const RecipeCard = styled(Card)(({ main }) => ({                                //searchbar
        backgroundColor: "#D2B48C",
        color: "white",
        margin: "10px",
        width: "20%",
        height: "80%",
      }));

    return(
        <RecipeCard>
            <h1>{name}</h1>
        </RecipeCard>);
}

export default RecipeCard;
